import React from "react";

const Admincard = ({ logo, name, p1, p2, p3 }) => {
  return (
    <div className="Card">
      {
        <>
          p1 ?
          <div className="logo">
            <img src={logo} className="img-fluid" alt={name} />
          </div>
          <div className="name">{name}</div> : ''
        </>
      }
    </div>
  );
};

export default Admincard;
